  `url_edit` int NOT NULL DEFAULT '0',
  `url_delete` int NOT NULL DEFAULT '0',
  `url_authentication_id` int NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`url_authentication_id`)
) ENGINE=InnoDB AUTO_INCREMENT=234 DEFAULT CHARSET=utf8mb3;

